import React from 'react';
import {
    AppBar, Button, CssBaseline, Link, Toolbar, Typography
} from '@material-ui/core';
import { 
    BrowserRouter as Router, Switch, Route, Link as RouterLink 
} from "react-router-dom";
import ChildCareIcon from '@material-ui/icons/ChildCare';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles(theme => ({
    '@global': {
        body: {
            backgroundColor: theme.palette.common.white,
        },
        ul: {
            margin: 0,
            padding: 0,
        },
        li: {
            listStyle: 'none',
        },
    },
    appBar: {
        borderBottom: `1px solid ${theme.palette.divider}`,
    },
    toolbar: {
        flexWrap: 'wrap',
    },
    toolbarTitle: {
        flexGrow: 1,
    },
    link: {
        margin: theme.spacing(1, 1.5),
    },
}));

const RefLink = React.forwardRef((props, ref) => <RouterLink innerRef={ref} {...props} />);

export default function AppAppBar() {
    const classes = useStyles();

    return (
        <React.Fragment>

            <CssBaseline />
            
            <AppBar position="static" color="default" elevation={0} className={classes.appBar}>
                <Toolbar className={classes.toolbar}>
                    <Router>

                        <ChildCareIcon fontSize="large" />
                        <Typography variant="h6" color="inherit" noWrap className={classes.toolbarTitle}>
                            Happy Walrus
                        </Typography>

                        <nav>
                            <Link variant="button" color="textPrimary" component={RefLink} to="/upload" className={classes.link}>
                                Get Started
                            </Link>
                            <Link variant="button" color="textPrimary" component={RefLink} to="/about" className={classes.link}>
                                About Us
                            </Link>
                        </nav>

                        <Button href="#" color="primary" variant="outlined" className={classes.link}>
                            Login
                        </Button>

                        <Button href="#" color="secondary" variant="outlined" className={classes.link}>
                            Sign Up
                        </Button>

                        <Switch>
                            <Route path="/about">
                                <About />
                            </Route>
                            <Route path="/upload">
                                <Upload />
                            </Route>
                            <Route path="/">
                                <App />
                            </Route>
                        </Switch>
                    </Router>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    )
}
